import React from "react";
import { Heading } from "./styles";
const Characters = () => {
  return (
    <>
      <Heading>Star Wars Characters</Heading>
      <div className="box">
        <div className="card">
          <div className="card-body">
            <h2>Name</h2>
          </div>
          <div class="card-footer">
            <a href="details.html">
              {" "}
              <h5>Details</h5>{" "}
            </a>
          </div>
        </div>
      </div>
    </>
  );
};

export default Characters;
